</head>
<body>
  <table class="table table-striped">
    <thead>
      <tr>
        <th onclick="sortTable(0)">Name</th>
        <th onclick="sortTable(1)">Age</th>
      </tr>
    </thead>
    <tbody id="myTable">
      <tr>
        <td>Alice</td>
        <td>25</td>
      </tr>
      <tr>
        <td>Bob</td>
        <td>30</td>
      </tr>
      <tr>
        <td>Charlie</td>
        <td>22</td>
      </tr>
      <tr>
        <td>David</td>
        <td>28</td>
      </tr>
    </tbody>
  </table>

  <script>
    function sortTable(n) {
      let table, rows, switching, i, x, y, shouldSwitch, dir, switchcount = 0;
      table = document.getElementById("myTable");
      switching = true;
      dir = "asc";
      rows = table.rows;
      for (i = 1; i < rows.length - 1; i++) {
        shouldSwitch = false;
        x = rows[i].getElementsByTagName("TD")[n];
        y = rows[i + 1].getElementsByTagName("TD")[n];
        if (dir == "asc") {
          if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
            shouldSwitch = true;
          }
        } else if (dir == "desc") {
          if (x.innerHTML.toLowerCase() < y.innerHTML.toLowerCase()) {
            shouldSwitch = true;
          }
        }
        if (shouldSwitch) {
          rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
          switchcount ++;
        }
      }
      if (switchcount == 0 && dir == "asc") {
        dir = "desc";
        switching = true;
      }
      for (i = 0; i < rows.length; i++) {
        rows[i].onclick = function() {
          this.parentNode.insertBefore(this, rows[0]);
        }
      }
    }
  </script>
</body>
</html>
```

In this example, the table is sorted by clicking the headers. The sorting is done in alphanumeric order (case-insensitive). The sorting direction is toggled between ascending and descending when clicking the same header multiple times.

